import React from 'react';

const Events = () => {
return (
	<div>
	<table>
		<tr>
			<td>World Film Festival</td>
			<tr>June 1, 2023 - June 22, 2023</tr>
			<td>Superman-The movie (1978). 45th anniversary screening</td>
			<td>June 25th , King's birthday special screenin of Movie "Elizabeth:The Golden Age"</td>
		</tr>
	</table>
	</div>
);
};

export default Events;
